%% make plot
close all
lwidth = 3;
ftsize = 14;
t_start = 199.765;
t_end = t_start + 15;
paper_size = [50, 50, 800, 400]./100;
h_fig = figure('Position',paper_size*100);
subplot('Position', [0.05, 0.17, 0.72, 0.8])
set(gcf,'color','w');
color = get(h_fig,'Color');
plot(sig.t-t_start, sig.v, 'LineWidth', lwidth, 'Color', [0.25 0.2 1]), hold on
if sum(strcmp(resp_sigs_to_plot, 'feature'))
    plot(pks.t-t_start, pks.v, '.-k', 'LineWidth', lwidth+3, 'MarkerSize', 35)
    plot(pks.t-t_start, pks.v, '.-r', 'LineWidth', lwidth-1, 'MarkerSize', 25)
end
if sum(strcmp(resp_sigs_to_plot, 'filter'))
    plot(bpf.t-t_start, bpf.v, 'k', 'LineWidth', lwidth+3)
    plot(bpf.t-t_start, bpf.v, 'y', 'LineWidth', lwidth)
end
plot(ref_resp.t-t_start, ref_resp.v, 'k', 'LineWidth', lwidth+3)
xlabel('Time [s]', 'FontSize', ftsize)
set(gca, 'YTick', [], 'FontSize', ftsize)
xlim([0, t_end-t_start])
rel_els = sig.t >= t_start & sig.t<= t_end;
rel_els2 = ref_resp.t >= t_start & ref_resp.t<= t_end;
ylim([min(sig.v(rel_els))-0.1*range(sig.v(rel_els)), max(ref_resp.v(rel_els2))+0.1*range(sig.v(rel_els))])
box off
set(gca, 'XTick', 0:5:20)

% Make annotations
dim = [.8 .75 .2 .2];
str = {'Reference', 'respiratory signal'};
annotation('textbox',dim,'String',str,'LineStyle', 'none', 'FontSize', ftsize);
if sum(strcmp(resp_sigs_to_plot, 'feature'))
    dim = [.8 .55 .2 .2];
    str = {'Feature-based', 'respiratory signal'};
    annotation('textbox',dim,'String',str,'LineStyle', 'none', 'FontSize', ftsize, 'Color', 'r');
end
if sum(strcmp(resp_sigs_to_plot, 'filter'))
    dim = [.8 .3 .2 .2];
    if sum(strcmp(resp_sigs_to_plot, 'feature'))
        str = {'Filter-based', 'respiratory signal'};
    else
        str = {'Extracted' 'respiratory signal'};
    end
    annotation('textbox',dim,'String',str,'LineStyle', 'none', 'FontSize', ftsize, 'Color', [0.4 0.4 0.1]);
end
dim = [.8 .1 .2 .2];
str = {'PPG'};
annotation('textbox',dim,'String',str,'LineStyle', 'none', 'FontSize', ftsize, 'Color', 'b');

% Setup paper dimensions
set(h_fig,'PaperUnits','inches');
set(h_fig,'PaperSize', [paper_size(3), paper_size(4)]);
set(h_fig,'PaperPosition',[0 0 paper_size(3) paper_size(4)]);

